const CreateGHI = async (formData, refreshData) => {
  try {
    const response = await fetch('https://6743ce15b7464b1c2a65e803.mockapi.io/GHI', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(formData),
    });

    if (response.ok) {
      console.log('데이터 생성 성공');
      refreshData(); 
    } else {
      console.error(`데이터 생성 실패: ${response.status}`);
    }
  } catch (error) {
    console.error('데이터 생성 중 오류 발생:', error);
  }
};

export default CreateGHI;
